module.exports = "<div class=\"hero-image\"  >\n  <nav class=\"navbar navbar-expand-sm  \" style=\"background-color: transparent;text-align: right;color:whitesmoke\">\n<div class=\"container\">\n<ul class=\"nav navbar-nav ml-auto\">\n\n  <li class=\"nav-item\" style=\"padding:5px;\">\n    <a routerLink=\"/Index\" >\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n      الصفحة الرئيسية  \n    </button>\n\n  </a>\n  </li>\n\n\n  <li class=\"nav-item\" style=\"padding:5px;\"> \n    <a routerLink=\"/signin\">\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n     تسجيل الدخول\n  </button>\n  </a>\n  </li>\n  <li class=\"nav-item\" style=\"padding:5px;\"> \n    <a routerLink=\"/signup\">\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n      التسجيل\n  </button>\n  </a>\n  </li>\n</ul>\n\n</div>\n\n</nav>\n  <div dir=\"rtl\" class=\"hero-text\">\n    <div style=\"text-align:center\">\n<h1 style=\"font-family:cairo;\"  >  سياسة الخصوصية \n</h1>\n<br>\n\n\n            </div>\n  </div>\n  \n</div>\n<br>\n\n<div class=\"container\" style=\"text-align: right;padding-top:5%\">\n  <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n  \nمقدمة\n\n  \n    </h3>\n  <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n\n    يلتزم موقع بوكشيلف بتوفير أقصى درجات الحماية لبياناتك الشخصية، ومن خلال قبولكم لسياسة الخصوصية الخاصة بموقع بوكشيلف ، فإنكم تسمحون لنا بجمع وإستخدام والكشف عن المعلومات الشخصية الخاصة بك فقط وفقاً لسياسة الخصوصية وبشكل محدود جداً. يرجى العلم بأنه لن يتم أبداً بيع أو إستخدام أوعرض بياناتك الشخصية إلى أية جهة بمقابل أو بدون.\n  </p>\n  \n  </div>\n  \n  \n  \n\n\n\n\n  <div class=\"container\" style=\"text-align: right;padding-top:5%\">\n    <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n    \n      : ماهي البيانات التي نجمعها وكيفية جمعها  \n    \n    \n      </h3>\n    <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n      عند فتح حساب جديد على موقع موقع بوكشيلف  ، نقوم بطلب مجموعة من البيانات الشخصية للعميل ، حيث يجب إكمال تلك البيانات بطريقة صحيحة لإتمام عملية التسجيل على الموقع .\n      وهذه البيانات مثل :\n      <br>\n      <br>\n      - الاسم، العنوان، البريد الإلكتروني، رقم الهاتف، وغيرها من المعلومات الأساسية.\n      <br>\n      <br>\n      - للتأكد من صحة بيانات العميل، قد نضطر لطلب إثبات شخصيتك ومكان إقامتك، مثل: نسخة من بطاقة الهوية، جواز سفر، رخصة قيادة .\n      \n\n\n\n    </p>\n    \n    </div>\n  \n    \n\n\n\n\n\n\n\n\n\n    <div class=\"container\" style=\"text-align: right;padding-top:5%\">\n      <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n      \n        : الاجراءات الامنية \n      \n      \n        </h3>\n      <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n        نقوم بتجميع بيانات الإستخدام والوصول التي تسمح لنا بمنع فتح الحسابات المتعددة أو السلوكيات الإحتيالية أو لحماية أنظمتنا ضد الإعتداءات الغير مشروعة.\n\n\n      </p>\n      \n      </div>\n  \n      \n\n\n\n\n\n\n\n\n  \n  \n  \n  \n  \n  \n  <div class=\"container\" style=\"text-align: right;padding-top:5%;padding-bottom:10%\">\n    <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n    \n      : الحماية     \n      </h3>\n    <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n      \n      يلتزم موقع بوكشيلف بالتعامل مع معلومات الحساب الخاص بك بمستوى عالي من الأمن وحماية البيانات الشخصية ضد الوصول غير المصرح به. بمجرد تسجيل الدخول إلى حسابك ونقل المعلومات الخاصة بك عبر الإنترنت، يتم تأمين كل اتصالات الإنترنت باستخدام تقنية (SSL: Secure Socket Layer) مع حماية عالية التشفير 128BIT لضمان عدم وصول بياناتك الخاصة إلى أي شخص على شبكة الانترنت.\n      <br>\n      ومع ذلك، يمكن لهذا المستوى من الحماية ألا يكون فعال بنسبة 100% إلا إذا كنت تتبع سياسات أمنية خاصة بك.\n      <br>\n      يجب عليك ألا تشارك بيانات حسابك مع أي شخص. وإذا كنت تشعر بالقلق بأن أي من بياناتك الشخصية قد كشفت، يجب عليك تغييرها على الفور بعد تسجيل الدخول على حسابك.\n      \n\n    </p>\n    \n    </div>"

