module.exports = "<div class=\"hero-image\"  >\n  <nav class=\"navbar navbar-expand-sm  \" style=\"background-color: transparent;text-align: right;color:whitesmoke\">\n<div class=\"container\">\n<ul class=\"nav navbar-nav ml-auto\">\n\n  <li class=\"nav-item\" style=\"padding:5px;\">\n    <a routerLink=\"/Index\">\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n      الصفحة الرئيسية  \n    </button>\n\n  </a>\n  </li>\n\n\n  <li class=\"nav-item\" style=\"padding:5px;\"> \n    <a routerLink=\"/signin\">\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n     تسجيل الدخول\n  </button>\n  </a>\n  </li>\n  <li class=\"nav-item\" style=\"padding:5px;\"> \n    <a routerLink=\"/signup\">\n        <button class=\"btn \" style=\"background-color:transparent;color: white;border:1px solid whitesmoke \">\n\n      التسجيل\n  </button>\n  </a>\n  </li>\n</ul>\n\n</div>\n\n</nav>\n  <div dir=\"rtl\" class=\"hero-text\">\n    <div style=\"text-align:center\">\n<h1 style=\"font-family:cairo;\"  >  من نحن \n</h1>\n<br>\n\n\n            </div>\n  </div>\n  \n</div>\n<br>\n\n<div class=\"container\" style=\"text-align: right;padding-top:5%\">\n  <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n  \n  :من نحن\n  \n  \n    </h3>\n  <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n      ارتفاع أسعار الكتب، إنخفاض مستوى الدخل، التمسك بالمبادئ وعدم الرغبة فى قراءة الكتب الإلكترونية المسروقة كلها عوامل أدت إلى عزوف الكثير عن القراءة أو القراءة بشكل أقل مما تعودوا عليه في السنوات السابقة وتأثر بهذه المعادلة الجميع، الغني قبل الفقير، فالجميع لديه إلتزاماته فإضطروا للتضحية بالقراءة في سبيل الإلتزامات الأخرى.\n  \n      بدأ الناس في الإعتماد على الإستعارة. استعارتك للكتاب يجعل مكتبتك المعرفية تتضخم بشكل كبير وسريع دون التفكير في الأعباء المالية بعد أن تم استبعاد العنصر المالي من المعادلة ولكن \" الحلو ميكملش\" كما نقول في مصر، حيث لا توجد الكثير من المكتبات العامة التي تستطيع الإستعارة منها بسهولة، أو سهولة إقناع أصدقائك بالتفريط في كتبهم حيث أن الأغلب يرفض.\n      \n      فكان الحل البديل وهو التبادل حيث بدأ الناس بتبادل الكتب فيما بينهم لقراءة أكبر قدر من الكتب دون رفع الأعباء المالية عليهم، ولكن تبقت مشكلة \"الرغبة المشتركة\" فالكثير يجد ضالته عند زميله أو صديقه وعندما يخبره برغبته في مبادلة هذا الكتاب معه يفاجأ بعدم رغبة الطرف الآخر بأي من كتبه فتتوقف العملية للأسف.\n      \n      هنا وجب ظهور الحل !\n      \n      بوكابكيا أول موقع لتبادل الكتب بأسلوب فريد من نوعه حيث أنشأنا مكتبة بوكابكيا العامة لتبادل الكتب مع أي فرد داخل مصرأو أكثر من فرد في نفس المرة.\n  </p>\n  \n  </div>\n  \n  \n  \n  \n  \n  \n  \n  \n  \n  <div class=\"container\" style=\"text-align: right;padding-top:5%;padding-bottom:10%\">\n    <h3 style=\"padding-bottom:2.5%;padding-right:15%\" >\n    \n      :كيف يعمل الموقع   \n    \n      </h3>\n    <p style=\"padding-right:15%;padding-left:15%;text-align:justify\" dir=\"rtl\">\n      \n  بعد أن تقوم بإنشاء حسابك على موقع بوكابكيا وتقوم بتجهيز كتبك التي ترغب في تبديلها، ستقوم بعمل طلب تبرع للموقع بكتبك، وسوف يقوم فريق التوصيل بالقدوم إليك لأخذ الكتب فى خلال أيام، وقبل مرور 24 ساعة بعد إستلام الكتب منك سوف تتم إضافة رصيد من عملات موقع بوكابكيا إلى حسابك الذي سيمكنك من شراء أي كتاب قام بالتبرع به شخص آخر للموقع، و ستتمكن من شراء أكثر من كتاب مختلف من أكثر من شخص مختلف في نفس الوقت دون الحاجة لرغبتهم الشخصية في كتبك، أنت لا تقلق فهناك آخرون يرغبون بكتبك وهكذا تكتمل السلسلة.\n  \n  لاحظ فعليا إنك تخلصت من كتبك الغير مرغوب فيها، إشتريت أو إستعرت كتب أخرى دون أن تدفع سوى رسوم الشحن فقط ، وأنهينا مشكلة الرغبة المشتركة بين الأطراف.\n    </p>\n    \n    </div>"

